int getint()
{
  char n = 0;
  char c;
  do
  {
    c = getchar_unlocked();
  }
  while (((c < '0') || (c > '9')) && (c != EOF));
  if (c == EOF)
  {
    return 0;
  }

  do
  {
    n = (((n << 3) + (n << 1)) + c) - '0';
  }
  while (((c = getchar_unlocked()) >= '0') && (c <= '9'));
  return n;
}

