int fill(int row, int col)
{
  if ((((col < 0) || (col > row)) || (row > (t - 1))) || (row < 0))
    return 0;

  if (table[row][col] == 0)
  {
    if ((row - 1) >= 0)
    {
      unsigned int val1;
      unsigned int val2;
      if ((col - 1) >= 0)
      {
        if (table[row - 1][col - 1] == 0)
        {
          table[row - 1][col - 1] = fill(row - 1, col - 1);
        }

        val1 = arr[row][col] + table[row - 1][col - 1];
      }
      else
        val1 = arr[row][col];

      if (col <= (row - 1))
      {
        if (table[row - 1][col] == 0)
        {
          table[row - 1][col] = fill(row - 1, col);
        }

        val2 = arr[row][col] + table[row - 1][col];
      }
      else
        val2 = arr[row][col];

      table[row][col] = (val1 >= val2) ? (val1) : (val2);
    }
    else
      table[row][col] = arr[row][col];

  }

  return table[row][col];
}

