int calc_sum(int i, int j, int num, int **arr)
{
  if (temp[i][j] != (-1))
  {
    return temp[i][j];
  }

  if (i == (num - 1))
  {
    return arr[i][j];
  }

  int rightsum = arr[i][j] + calc_sum(i + 1, j + 1, num, arr);
  int leftsum = arr[i][j] + calc_sum(i + 1, j, num, arr);
  if (rightsum > leftsum)
  {
    temp[i][j] = rightsum;
    return rightsum;
  }
  else
  {
    temp[i][j] = leftsum;
    return leftsum;
  }

}

