void sort(int a[], int begin, int mid, int end)
{
  int i = begin;
  int j = mid + 1;
  int k = 0;
  int temp[(end - begin) + 1];
  while ((i <= mid) && (j <= end))
  {
    if (a[i] >= a[j])
      temp[k++] = a[i++];
    else
      temp[k++] = a[j++];

  }

  for (; i <= mid; ++i)
    temp[k++] = a[i];

  for (; j <= end; ++j)
    temp[k++] = a[j];

  for (i = 0; i < k; ++i)
    a[begin + i] = temp[i];

}

void partition(int a[], int begin, int end)
{
  if (begin == end)
    return;

  int mid = (begin + end) / 2;
  partition(a, begin, mid);
  partition(a, mid + 1, end);
  sort(a, begin, mid, end);
}

