long GCD(int A, int B)
{
  long reminder;
  if (B > A)
  {
    int temp;
    temp = A;
    A = B;
    B = temp;
  }

  while (B)
  {
    reminder = A % B;
    A = B;
    B = reminder;
  }

  return A;
}

long LCM(int A, int B)
{
  return (A * B) / GCD(A, B);
}

