int gcd(int a, int b)
{
  int temp;
  int rem;
  if (a > b)
  {
    temp = a;
    a = b;
    b = temp;
  }

  rem = b % a;
  if (rem == 0)
    return a;
  else
  {
    b = a;
    a = rem;
    return gcd(a, b);
  }

}

