  if (sum == 1)
  {
    *num = 1;
  }

  if (sum == 2)
  {
    while (sum >= 2)
    {
      *num = 0;
      carry = 1;
      count -= 1;
      num--;
      sum = (*num) + carry;
      sum_temp = sum;
    }

    *num = sum;
  }

}

