int recurse(int arr[], int front, int end)
{
  if (front < end)
  {
    if (arr[front] > arr[front + 1])
    {
      return recurse(arr, front + 1, end);
    }
    else
    {
      arr[front + 1] = arr[front];
      return recurse(arr, front + 1, end);
    }

  }
  else
  {
    return arr[front + 1];
  }

}

