    if (st[x + 1][l + 1] != 0)
      a = st[x + 1][l + 1];
    else
      a = (st[x + l][l + 1] = sit(x + l, l + 1, n, triangle, st));

    if (st[(x + 1) + 1][l + 1] != 0)
      b = st[(x + 1) + 1][l + 1];
    else
      b = (st[(x + l) + 1][l + 1] = sit((x + l) + 1, l + 1, n, triangle, st));

    st[x][l] = triangle[x - 1] + MAX(a, b);
    return st[x][l];
