{
  if (size <= 0)
  {
    return 0;
  }

  int currentInteger = triangle[xPosition][yPosition];
  if (size == 1)
  {
    return currentInteger;
  }

  int maximumBottom = getMaximumSumOfTriangle(triangle, xPosition, yPosition + 1, size - 1);
