int findMaxPath(int **array, int i, int j, int n, int **visited)
{
  if (i == n)
  {
    return 0;
  }

  if (visited[i][j])
  {
    return visited[i][j];
  }

  int t1 = findMaxPath(array, i + 1, j + 1, n, visited);
  int t2 = findMaxPath(array, i + 1, j, n, visited);
